import React, { useState, useEffect } from 'react';
import { auth } from '..//../firebase';
import { toast } from 'react-toastify';

const RegisterComplete = ({history}) => {
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");

    /**useState, 1st argument is an arrow function
     * and 2nd argument is dependencies.
     * This is known as a dependecy array.
     * At the moment it is empty by default.
     *  As an example, [password] was inside 
     * brackets, when it changes,
     * the function will run.
      */
    useState(() => {
        set(window.localStorage.getItem('emailForRegistration'))
    }, [])
    
    const handleSubmit = async (e) => {
        e.preventDefault();

    };

    const completeRegistrationForm = () => 
    <form onSubmit={handleSubmit}>
        <input 
        type="email" 
        className="form-control" 
        value={email} 
        autoFocus
        />

        <button type="submit" className="btn btn-raised">
        Complete Registration
        </button>
    </form>    

    return (
        <div className="container p-5">
            <div className="row">
                <div className="col-md-6 offset-md-3">
                    <h4>Register Complete</h4>
                    {completeRegistrationForm()}
                </div>
            </div>
        </div>
    );
};

export default RegisterComplete;
